import React, { useState } from 'react';
import axios from 'axios';
import Swal from 'sweetalert2';
import 'bootstrap/dist/css/bootstrap.min.css';

const Register = () => {
    const [formData, setFormData] = useState({
        usuario: {
            login: '',
            password: ''
        },
        persona: {
            primerNombre: '',
            segundoNombre: '',
            primerApellido: '',
            segundoApellido: '',
            email: '',
            fechaNacimiento: '',
            identificacion: '',  // Campo de identificación agregado
            ubicacion: {
                direccion: '',
                municipio: '',
                departamento: ''
            }
        }
    });

    const handleInputChange = (event) => {
        const { name, value } = event.target;
        const [field, subField] = name.split('.');

        if (subField) {
            setFormData({
                ...formData,
                [field]: {
                    ...formData[field],
                    [subField]: value
                }
            });
        } else {
            setFormData({
                ...formData,
                [field]: value
            });
        }
    };

    const handleSubmit = async (event) => {
        event.preventDefault();

        try {
            await axios.post('http://localhost:9001/Laboratorio1/persona', formData);
            Swal.fire({
                title: 'Éxito',
                text: 'Registro completado correctamente.',
                icon: 'success'
            });
            // Limpiar el formulario después del registro
            setFormData({
                usuario: {
                    login: '',
                    password: ''
                },
                persona: {
                    primerNombre: '',
                    segundoNombre: '',
                    primerApellido: '',
                    segundoApellido: '',
                    email: '',
                    fechaNacimiento: '',
                    identificacion: '',  // Limpiar el campo de identificación
                    ubicacion: {
                        direccion: '',
                        municipio: '',
                        departamento: ''
                    }
                }
            });
        } catch (error) {
            // Manejar error según el tipo de error
            if (error.response && error.response.status === 409) {
                Swal.fire({
                    title: 'Error',
                    text: 'El usuario ya existe. Intenta con otro.',
                    icon: 'error'
                });
            } else {
                Swal.fire({
                    title: 'Error',
                    text: 'Ocurrió un error en el registro.',
                    icon: 'error'
                });
            }
        }
    };

    return (
        <div className="container mt-5">
            <h2>Registro de Usuario</h2>
            <form onSubmit={handleSubmit}>
                <div className="mb-3">
                    <label htmlFor="usuario.login" className="form-label">Usuario</label>
                    <input
                        type="text"
                        className="form-control"
                        id="usuario.login"
                        name="usuario.login"
                        value={formData.usuario.login}
                        onChange={handleInputChange}
                        required
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="usuario.password" className="form-label">Contraseña</label>
                    <input
                        type="password"
                        className="form-control"
                        id="usuario.password"
                        name="usuario.password"
                        value={formData.usuario.password}
                        onChange={handleInputChange}
                        autoComplete="current-password" // Atributo de autocompletado agregado
                        required
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="persona.primerNombre" className="form-label">Primer Nombre</label>
                    <input
                        type="text"
                        className="form-control"
                        id="persona.primerNombre"
                        name="persona.primerNombre"
                        value={formData.persona.primerNombre}
                        onChange={handleInputChange}
                        required
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="persona.segundoNombre" className="form-label">Segundo Nombre</label>
                    <input
                        type="text"
                        className="form-control"
                        id="persona.segundoNombre"
                        name="persona.segundoNombre"
                        value={formData.persona.segundoNombre}
                        onChange={handleInputChange}
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="persona.primerApellido" className="form-label">Primer Apellido</label>
                    <input
                        type="text"
                        className="form-control"
                        id="persona.primerApellido"
                        name="persona.primerApellido"
                        value={formData.persona.primerApellido}
                        onChange={handleInputChange}
                        required
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="persona.segundoApellido" className="form-label">Segundo Apellido</label>
                    <input
                        type="text"
                        className="form-control"
                        id="persona.segundoApellido"
                        name="persona.segundoApellido"
                        value={formData.persona.segundoApellido}
                        onChange={handleInputChange}
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="persona.email" className="form-label">Email</label>
                    <input
                        type="email"
                        className="form-control"
                        id="persona.email"
                        name="persona.email"
                        value={formData.persona.email}
                        onChange={handleInputChange}
                        required
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="persona.fechaNacimiento" className="form-label">Fecha de Nacimiento</label>
                    <input
                        type="date"
                        className="form-control"
                        id="persona.fechaNacimiento"
                        name="persona.fechaNacimiento"
                        value={formData.persona.fechaNacimiento}
                        onChange={handleInputChange}
                        required
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="persona.identificacion" className="form-label">Identificación</label>
                    <input
                        type="text"
                        className="form-control"
                        id="persona.identificacion"
                        name="persona.identificacion"
                        value={formData.persona.identificacion}
                        onChange={handleInputChange}
                        required
                    />
                </div>
                <h4>Ubicación</h4>
                <div className="mb-3">
                    <label htmlFor="persona.ubicacion.direccion" className="form-label">Dirección</label>
                    <input
                        type="text"
                        className="form-control"
                        id="persona.ubicacion.direccion"
                        name="persona.ubicacion.direccion"
                        value={formData.persona.ubicacion.direccion}
                        onChange={handleInputChange}
                        required
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="persona.ubicacion.municipio" className="form-label">Municipio</label>
                    <input
                        type="text"
                        className="form-control"
                        id="persona.ubicacion.municipio"
                        name="persona.ubicacion.municipio"
                        value={formData.persona.ubicacion.municipio}
                        onChange={handleInputChange}
                        required
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="persona.ubicacion.departamento" className="form-label">Departamento</label>
                    <input
                        type="text"
                        className="form-control"
                        id="persona.ubicacion.departamento"
                        name="persona.ubicacion.departamento"
                        value={formData.persona.ubicacion.departamento}
                        onChange={handleInputChange}
                        required
                    />
                </div>
                <button type="submit" className="btn btn-primary">Registrar</button>
            </form>
        </div>
    );
};

export default Register;
